import './App.css';
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import About from "./Componants/About";
import {Navbar}  from './Componants/Navbar';
import Home from './Componants/Home';
import NoteState from './Constaxt/notes/NoteState';
import Login from './Componants/Login';
import SignupUser from './Componants/SignupUser';
import Alert from './Componants/Alert';

function App() {
  const [text, settext] = useState("")
  const [type, settype] = useState("")

  return (
    <>
    <NoteState>
      <Router>
        <Navbar />
        <Alert type={type} text={text}/>
        <div className="container">
        <Routes>
          <Route exact path='/' element={<Home set/>}/>
          <Route exact path='/about' element={<About set/>} />
          <Route exact path='/login' element={<Login set/>} />
          <Route exact path='/singup' element={<SignupUser set/>} />
        </Routes>
        </div>
      </Router>
    </NoteState>
    </>
  );
}

export default App;
